      Twitter{" "}
      <a target="_blank" rel="noreferrer" href="https://twitter.com/tgrecojs">
        @tgrecojs
      </a>{" "}
      | GitHub{" "}
      <a target="_blank" rel="noreferrer" href="https://github.com/tgrecojs">
        @tgrecojs
      </a>
    </p>
  </footer>
);

export default Footer;
